import React from 'react'

class Page extends React.Component {
    render(){

        const divStyles = {
            width : 800,
            height: 800,
            textAlign: 'center',
            border: '1px solid black',
            marginLeft: '400px',
            marginRight: '300px',
        }

        return (
            <div style={divStyles}>
                <h1>Hello, what is your name?</h1>
                <input  type="text" 
                        value={this.state.value}
                        onChange={this.handleChange}></input>  
                <hr></hr>
                <button onClick>OK</button>          
                </div>
        )
    }

}

export default Page
